Because JsonString cannot automatically be round tripped with Serialize and Deserialize , the following can cause difficulty: #[derive(Serialize, Deserialize)]
struct Foo { bar: JsonString,
} The compiler will complain about this because anything deriving Serialize recursively must consist only of values that also implement Serialize . There are a few approaches here, each with benefits and tradeoffs. Swap out JsonString with String Use a serde attribute to manually serialize Bar Use a serde attribute to skip Bar Create a "new type" or wrapper/conversion struct Swap JsonString with String This approach is quick and dirty. Simply change the type of Bar to String . When prototyping or on deadline, this might be the most attractive option ;) This will likely cause problems upstream and downstream of what you are doing, or may be symptomatic of poorly handled JSON somewhere. This is roughly how Entry used to work, with a String valued SerializedEntry and JsonString valued Entry that could be swapped between using a From implementation. Done correctly we can "onboard" values to Foo by simply carefully wrapping and unwrapping the String . Done badly, we reintroduce the possibility for invalid wrap/nest/etc. logic to creep in. This works best when the fields on Foo are private and immutable, exposed only through getter/setter/new style methods that internally convert between JsonString and String . This option is less suitable if we want to double serialize the nested JSON data when serializing Foo . For an example of where we preserve JSON rather than trying to automatically deserialize or wrap it with structs, see the return values from hdk::call (not using structs, but similar ideas). Also consider that somebody reading your code might entirely miss the fact that Foo::bar is JSON data if all they read is the struct definition. It may be worthwhile adding methods to Foo to enforce this: #[derive(Serialize, Deserialize)]
pub struct Foo { bar: String,
} impl Foo { pub fn new(bar: JsonString) -> Foo { Foo {bar: String::from(bar)} } pub fn bar(&self) -> JsonString { JsonString::from(self.bar.clone()) }
} Treat bar as though it was going to be stored as a JsonString right until the last moment. Avoid this: let bar_json = json!({"bar": bar.inner()}).to_string();
// somwhere later...
let foo = Foo{bar: bar_json}; Because then everything that needs to use Foo must consistently implement the manual jsonification logic. This is especially important if Foo and/or bar is to be used across multiple crates. Instead, prefer this: #[derive(Serialize, Deserialize, Debug, DefaultJson)]
struct Bar { bar: ..
} let bar_json = JsonString::from(Bar{bar: ..});
let foo = Foo::new(bar); // assuming impl Foo::new from above The result is still a raw String in Foo but the validity and consistency of the JSON data is enforced across all crates by JsonString::from(bar) . It is even possible to internalise the JsonString completely within the Foo methods using Into<JsonString> . This is covered in more detail below. Using serde attributes Serde allows us to set serialization logic at the field level for structs. The best example of this is handling of AppEntryValue in core. As all zome data is treated as JSON, assumed to line up with internal structs in the HDK but potentially opaque string primitives (see above) we simply alias AppEntryValue to JsonString . The Entry enum needs to be serialized for many reasons in different contexts, including for system entries that zome logic never handles directly. It looks something like this (at the time of writing): #[derive(Clone, Debug, Serialize, Deserialize, DefaultJson)]
pub enum Entry { #[serde(serialize_with = "serialize_app_entry")] #[serde(deserialize_with = "deserialize_app_entry")] App(AppEntryType, AppEntryValue), Dna(Dna), AgentId(AgentId), Delete(Delete), LinkAdd(LinkAdd), LinkRemove(LinkRemove), LinkList(LinkList), ChainHeader(ChainHeader), ChainMigrate(ChainMigrate),
} Note that Entry : Derives Serialize and Deserialize and even DefaultJson ! Contains AppEntryValue in a tuple, which is a JsonString Uses some serde serialization attributes This works because the serialization attributes tell serde how to handle the JsonString in this context . This is a double edged sword. We have explicit control over the serialization so we can never accidentally wrap/nest/etc. JSON data in an invalid way. We also only define the serialization for this type in this one place. If AppEntryValue was used in some other struct/enum, we would have to manually remember to use the same or compatible serialize/deserialize callbacks. This approach also gives a lot of control over the final JSON structure. We can avoid stutters and reams of redundant data in the final output. This can mitigate the verbosity and awkwardness of compiler-driven JSON structures when sending data to other languages (see above). The serde documentation explains in great (technical) detail how to implement custom serialization and deserialization logic for many different data types: https://serde.rs/field-attrs.html For reference, the callbacks used in Entry above look like this: pub type AppEntryValue = JsonString; fn serialize_app_entry<S>( app_entry_type: &AppEntryType, app_entry_value: &AppEntryValue, serializer: S,
) -> Result<S::Ok, S::Error>
where S: Serializer,
{ let mut state = serializer.serialize_tuple(2)?; state.serialize_element(&app_entry_type.to_string())?; state.serialize_element(&app_entry_value.to_string())?; state.end()
} fn deserialize_app_entry<'de, D>(deserializer: D) -> Result<(AppEntryType, AppEntryValue), D::Error>
where D: Deserializer<'de>,
{ #[derive(Deserialize)] struct SerializedAppEntry(String, String); let serialized_app_entry = SerializedAppEntry::deserialize(deserializer)?; Ok(( AppEntryType::from(serialized_app_entry.0), AppEntryValue::from(serialized_app_entry.1), ))
} Obviously this is a lot of boilerplate for one tuple, and is really only the tip of the iceberg for how complex custom serde implementations can get. Use this for surgical implementations along critical path type safety/ergonomics. Skip the attribute Serde also allows for attributes to be completely skipped during serialization. In the context of a JsonString this is unlikely to be the desired behaviour. If we are serializing the outer struct we probably want the inner JSON data to also be serialized, but not necessarily, or perhaps we don't need it and so can live without it. This option has very clear tradeoffs. We lose the JSON data when the outer struct is serialized but also don't have to worry about how it might be represented. This option is very handy during development/prototyping/debugging when you want to sketch out a larger idea without immediately tackling serde logic. Simply add the #[serde(skip)] attribute to your struct. #[derive(Serialize, Deserialize)]
