struct Bar(String) #[derive(Serialize, Deserialize)]
struct Foo { bar: Bar,
} impl Foo { fn new(bar: Bar) -> Foo { Foo { bar } } fn bar(&self) -> Bar { self.bar.clone() }
} // somewhere else...
